import React from 'react'
import {Container, Row, Col} from 'react-bootstrap'

export default function Projects() {

  const projects = [
    {title: 'Task Management', description:'lala'},
    {title: 'Search App', description:'lala'},
    {title: 'Calculator', description:'lala'}
  ];

  return (
    <Container>
      <Row className='projects-overall'>
        <h2>Projects</h2>
        <p>Here displays all my React projects</p>
      </Row>
      <Row>
        <Col></Col>
        <Col></Col>
      </Row>
    </Container>
  )
}
